import React from 'react';
import './App.css';
import OutputPanel from './components/OutputPanel';



let x = 0;
let w = 0;
let resizer;
let outputPanel;




class App extends React.Component {


  render() {
    return (
      <div id="App">

        {/*Header bar on top of the screen*/}
        <div id="headerBar">

          <div id="logo"></div>

          <div id="dropdown-containers"></div>

        </div>


        {/*Containing the code editor and the output panel*/}
        <div id="workspace">

          <div id="editor"></div>

          <OutputPanel />

        </div>

      </div>
    );
  }
}



export default App;
